    false,nt"url": null,nt"notes": "The Biological Monitoring Program is a
    part of the Western Riverside County Multi-Species Habitat Conservation Plan (MSHCP),
    which was permitted in June, 2004. The Monitoring Program monitors the status of
    146 Covered Species within a designated Conservation Area to provide information
    to permittees, land managers, the public, and wildlife agencies (i.e., the California
    Department of Fish and Wildlife and the U.S. Fish and Wildlife Service). Monitoring
    Program activities are guided by MSHCP species objectives for each Covered Species,
    the information needs identified in Section 5.3 of the MSHCP (http://www.rctlma.org/mshcp/volume1/sec5.html#5.3)
    or elsewhere in the document, and the information needs of the permittees. The Biological
    Monitoring Program seeks to provide sufficient scientifically reliable data to assess
    the MSHCP's effectiveness at meeting resource objectives and achieving or maintaining
    a healthy MSHCP Conservation Area in perpetuity. This is a shapefile depicting the
    geographic locations of general area names used by the Western Riverside County
    Biological Monitoring Program.",nt"license_title": null,nt"extras": [{ntt"key":
